window.bookSummaryJSON = "<p>A fantasy epic 20 years in the making! Enter a world of courageous animals, uncommon heroes, and epic battles!</p> <p>The young rabbit Sebastian Perriwinkle is swept off on a quest - along with the enigmatic badger Plotonicus and the mystical fox Brand Redtail to find the legendary human race. Together they unravel the mystery of an ancient war and confront the ultimate darkness, The Lord Ouroboros.</p> <p>The complete, unabridged audiobook of <i>Carrot Field</i> is narrated by Tony Cleary (BBC) and scored by Brian Arthur. Produced, engineered, and edited by Tony Cleary.</p> <p>\"Rich with the details of an intricately conceived fantasy world...echoes of C.S Lewis and Tolkien... <i>Carrot Field</i> stands apart...Vincent Asaro has spun quite a yarn.\" - Simon West Bulford, <i>The Beasts of Upton Puddle</i>, Medallion Press</p>"; 
